                'auditable_type' => 'App\\Models\\Recipe',
                'auditable_id' => 32,
            'old_values' => '{"id":32,"title":"Crispy Rice Cereal Chocolate Cheesecake","ingredients":"<p>unsalted butter, 1\\/2 stick<\\/p>\\n<p>mini marshmallows (285 g)<\\/p>\\n<p>crispy rice cereal (180g)<\\/p>\\n<p>semisweet chocolate (225g)<\\/p>\\n<p>haevy cream ( 60ml)<\\/p>\\n<p>cream cheese, softened (445g)<\\/p>\\n<p>sugar (100g)<\\/p>\\n<p>vanilla<\\/p>\\n<p>whipped cream, divided (150g)<\\/p>\\n<p>choclate bar for shaving (90g)<\\/p>","methodology":"<p>1. In a large saucepan over medium heat, melt the butter.<br \\/>2. Add the marshmallows and stir until melted. Add the crispy rice cereal and stir to coat.<br \\/>3. While the crispy rice cereal mix is still warm, transfer them to a greased 10-inch (25 cm) springform pan.<br \\/>4. Using a greased measuring cup, press down into the cereal to form to the pan. Press the edges against the springform pan to create walls. Set aside.<br \\/>5. Place the chocolate in a small microwave-safe bowl and pour the heavy cream on top. Microwave in 30-second intervals, stirring until melted, about 1 minute.<br \\/>6. In a large bowl, mix the cream cheese, sugar, and vanilla until smooth.<br \\/>7. Pour in the melted chocolate and stir to incorporate.<br \\/>8. Add 1&frac12; cups (90 g) of whipped cream to the chocolate mixture and fold with a spatula until combined.<br \\/>9. Pour the cheesecake mixture into the crispy rice base and smooth the top with a spatula.<br \\/>10. Refrigerate for 3-4 hours or overnight, until the cheesecake is set. Release the springform.<br \\/>11. Put the remaining cup of whipped cream in a piping bag fitted with a star tip and decorate the top of the cheesecake.<br \\/>12. Use a vegetable peeler to shave the chocolate into the middle of the cheesecake.<br \\/>13. Slice and serve.<br \\/>14. Enjoy!<\\/p>","image":"1592253793.png","category_id":8,"servings":10,"prep_time_hours":180,"prep_time_minutes":null,"cook_time_hours":0,"cook_time_minutes":null,"personal":0,"views":11,"source":null,"private_notes":null,"public_notes":null,"user_id":3,"modified_by_id":3,"last_viewed_by_id":3,"last_viewed_on":"2020-06-15 16:43:13","published_at":"2020-06-15 16:43:32"}',
